The structure I am trying to supercharge is the following:</p>
<pre><code>{
    &quot;_id&quot; : ObjectId(&quot;62b489664cbb9bc8c947f19f&quot;),
    &quot;user_id&quot; : ObjectId(&quot;61a775da4cbb9bc8c947edd9&quot;),
    &quot;product_types&quot; : [ 
        {
            &quot;type&quot; : NumberLong(1),
            &quot;product_id&quot; : ObjectId(&quot;62b4890f4cbb9bc8c947e5ef&quot;),
        }, 
        {
            &quot;type&quot; : NumberLong(1),
            &quot;product_id&quot; : ObjectId(&quot;62b4890f4cbb9bc8c947e5ed&quot;),
        }
    ]
}
</code></pre>
<p>I am trying to add product data from product_id, and I think I am pretty close to it, but I am adding 2 identical products in an array instead of the correct one:
Query:</p>
<pre><code>db.getCollection('interests').aggregate([
    {
        $lookup:{
            from: &quot;products&quot;,
            localField: &quot;product_types.product_id&quot;,
            foreignField: &quot;_id&quot;,
            as: &quot;productInterestData&quot;
        }
    },
    {
      $set: {
        &quot;product_types.product&quot;: {
          $map: {
            input: &quot;$product_types&quot;,
            in: {
              $mergeObjects: [
                &quot;$this&quot;,
                {
                    $arrayElemAt: [
                      &quot;$productInterestData&quot;,
                      {$indexOfArray: [&quot;$productInterestData.id&quot;, &quot;$this.id&quot;]}
                    ]
                }
              ]
            }
          }
        }
      }
    },
    {$unset: &quot;productInterestData&quot;}
  ])
</code></pre>
<p>Result (with an array of 2 identical products, instead of the correct one):</p>
<pre><code>{
    &quot;_id&quot; : ObjectId(&quot;62b489664cbb9bc8c947f19f&quot;),
    &quot;user_id&quot; : ObjectId(&quot;61a775da4cbb9bc8c947edd9&quot;),
    &quot;product_types&quot; : [ 
        {
            &quot;type&quot; : NumberLong(0),
            &quot;product_id&quot; : ObjectId(&quot;62b4890f4cbb9bc8c947e5ef&quot;),
            &quot;product&quot; : [ 
                {
                    &quot;_id&quot; : ObjectId(&quot;62b4890f4cbb9bc8c947e5ef&quot;),
                    &quot;name&quot; : &quot;olive&quot;,
                }, 
                {
                    &quot;_id&quot; : ObjectId(&quot;62b4890f4cbb9bc8c947e5ef&quot;),
                    &quot;name&quot; : &quot;olive&quot;,
                }
            ]
        }, 
        {
            &quot;type&quot; : NumberLong(1),
            &quot;product_id&quot; : ObjectId(&quot;62b4890f4cbb9bc8c947e5ed&quot;),
            &quot;product&quot; : [ 
                {
                    &quot;_id&quot; : ObjectId(&quot;62b4890f4cbb9bc8c947e5ef&quot;),
                    &quot;name&quot; : &quot;olive&quot;,
                }, 
                {
                    &quot;_id&quot; : ObjectId(&quot;62b4890f4cbb9bc8c947e5ef&quot;),
                    &quot;name&quot; : &quot;olive&quot;,
                }
            ]
        }
    ]
}
</code></pre>
<p>Any idea on how to fix the query to have only one product instead of an array of identical ones?</p>

