mongoose add a field to a document from another document<p>I want to get categories by limit, offset, orderBy viewers from VideoSchema</p>
<pre class="lang-js prettyprint-override"><code>const CategoriesSchema = new Schema&lt;ICategories&gt;({
  name: String,
  image: String,
});

const VideoSchema = new Schema&lt;IVideo&gt;({
  videoSource: String,
  // from CategoriesSchema
  category: {
    name: String,
    image: String,
  },
  viewers: Number,
});
</code></pre>
<p>What i do to get what i want:</p>
<pre class="lang-js prettyprint-override"><code>const resolver = async ({ args: { limit, offset } }) =&gt; {
      // there are 60k+ categories so request will be long
      const categories = await CategoriesModel.find();
      for (let i = 0; i &lt; categories.length; i++) {
        const streams = await VideosModel.find({ 'category.name': categories[i].name });
        categories[i] = {
          ...categories[i],
          // count viewers of current video
          viewers: streams.reduce((acc, curr) =&gt; acc + curr.viewers, 0),
        };
      }
      // sort by viewers, slice array by limit and offset
      return categories.sort(({ viewers: viewersA = 0 }, { viewers: viewersB = 0 }) =&gt; viewersB - viewersA).slice(offset, limit);
  },
</code></pre>
<p>I understand that request is not optimized, but I can't figure out how to do request by limit and offset and sort it by current viewers count. I know that in relational database like mysql i can use left join for that case, but don't understand how to do something like that with mongoose</p>
<p>Clean up:</p>
<p><a href="https://i.stack.imgur.com/uaQZ2.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/uaQZ2.png" alt="enter image description here" /></a></p>
<p>There is Categories list, each category have number of viewers from VideoSchema (viewers field). If there is no video for that category then should have 0 viewers or if we have video for that category we print number of viewers from 0 to 2^32</p>
<p>Also I have changes in VideoSchema, for now its with ref to Categories</p>
<pre><code>const VideoSchema = new Schema&lt;IVideo&gt;({
  videoSource: String,
  // from CategoriesSchema
  category: {
    ref: 'Categories'
  },
  viewers: Number,
});
</code></pre>

