Use $addFields to add field to each item in $lookup results<p>I have two collections in my MongoDB database, <code>category</code> and <code>product</code>, there is a One-to-many relation between these two. So I get what I want like this:</p>
<pre><code>db.category.aggregate([
  {
    &quot;$lookup&quot;: {
      &quot;from&quot;: &quot;product&quot;,
      &quot;localField&quot;: &quot;_id&quot;,
      &quot;foreignField&quot;: &quot;category_id&quot;,
      &quot;as&quot;: &quot;products&quot;
    }
  }
])
</code></pre>
<p>It works perfectly fine, now I want to add a new field <code>id</code> equal to <code>_id</code> to each product in the products array. After many hours of research this is the closest thing I could find:</p>
<pre><code>db.category.aggregate([
  {
    &quot;$lookup&quot;: {
      &quot;from&quot;: &quot;product&quot;,
      &quot;localField&quot;: &quot;_id&quot;,
      &quot;foreignField&quot;: &quot;category_id&quot;,
      &quot;as&quot;: &quot;products&quot;
    }
  },
  {
    $addFields: {
      &quot;id&quot;: &quot;$_id&quot;,
      &quot;product.id&quot;: &quot;$products._id&quot;
    }
  },

])
</code></pre>
<p>Which will add <code>id</code> field but it's value is equal to an array containing ALL the product <code>_id</code>s !</p>
<p>I created this in Mongo Playground in case you want to check it out:
<a href="https://mongoplayground.net/p/bQy_yf0c52h" rel="nofollow noreferrer">https://mongoplayground.net/p/bQy_yf0c52h</a></p>
<p>Any help is highly appreciated.
Thanks</p>

