How to type the MongoDB projection results<p>When I query with projections then I expect the type to be different. For example, my collection has documents of type User.</p>
<pre><code>interface User {
    _id?: ObjectId
    username: string
    foo: number
}
</code></pre>
<p>And when I query it, then I expect the result to be of type UserView</p>
<pre><code>interface UserView {
    _id: ObjectId
    username: string
}

</code></pre>
<p>My Repository looks something like this.</p>
<pre><code>class UserRepository {
    private collection: Collection&lt;User&gt;

    constructor(db: Db) {
        this.collection = db.collection&lt;User&gt;('User')
    }

    public async getUserById(id: ObjectId): Promise&lt;UserView | null&gt; {
        // Result has type User
        const result = await this.collection
            .findOne({ _id: ${ eq: id } }, { projection: { _id: 1, username: 1 })
    }
}
</code></pre>
<p>Current solutions I can think of is that I create a new collection with each type like this.</p>
<pre><code>this.collection = db.collection&lt;User&gt;('User')
this.viewCollection = db.collection&lt;UserView&gt;('User')
</code></pre>
<p>or leave the typing out and return the function like this:</p>
<pre><code>    public async getUserById(id: ObjectId): Promise&lt;UserView | null&gt; {
        // Result has type Document
        const result = await this.collection
            .findOne({ _id: ${ eq: id } }, { projection: { _id: 1, username: 1 })
        if (result) return result as Userview
        return null
    }
</code></pre>
<p>What's the best approach to have proper typing in my MongoDB queries with projections?</p>

