Find Parent objects through intermediated child collection in MongoDB<p>In my Mongo database I have a list of Projects and a list of ProjectUsers any of whom potentially have different permissions on any given Project. Any Project may have multiple users and any ProjectUser may have permissions on multiple Projects. I have defined the ProjectUser and the Project as entities, with a Permissions collection as a subdocument of the Project.</p>
<p>The relevant parts of my schema look like this:</p>
<pre><code>const ProjectUserSchema = {
    name: { type: String, required: true },
    email: { type: String, required: true }
    // and so on.
};

const UserPermissionSchema = {
    user: { type: Schema.Types.ObjectId, ref: &quot;ProjectUser&quot; },
    level: { type: Number, required: true }
}

const ProjectSchema = {
    name: { type: String, required: true },
    permissions: [ UserPermissionSchema ]
}

</code></pre>
<p>This works fine for interacting with a Project as we can quickly tell what users have which permissions, but I can't figure out what I need to do in order to query all the projects that the current user has permissions on.</p>
<p>A sample Project object looks like this:</p>
<pre><code>{ &quot;_id&quot; : ObjectId(&quot;62b44bc0aaa95c60c065df60&quot;), 
 &quot;name&quot; : &quot;My super-secret plan&quot;,
  &quot;permissions&quot; : [ 
      { &quot;user&quot; : ObjectId(&quot;62b9d3691af5d2cb26e08574&quot;), &quot;level&quot; : 1,  &quot;_id&quot; : ObjectId(&quot;62bed68c4d58c0c32c66c571&quot;) }, 
      { &quot;user&quot; : ObjectId(&quot;62befc5429b845a8eb552423&quot;), &quot;level&quot; : 1, &quot;_id&quot; : ObjectId(&quot;62bf041629b845a8eb5524b5&quot;) } 
   ], 
   &quot;__v&quot; : 13 
} 
</code></pre>
<p>I have tried a simple <code>db.projects.find(&quot;permissions.user._id&quot;: ObjectId(&quot;62b9d3691af5d2cb26e08574&quot;))</code> and more complicated queries using aggregations like <code>db.projects.find({ &quot;permissions&quot;: { $elemMatch: { &quot;field&quot;: &quot;user&quot;, &quot;value&quot;: ObjectId(&quot;62befc5429b845a8eb552423&quot;)}}});</code> but no amount of tweaking those values around seems to be working.</p>
<p>I'm using Mongoose for my application code, I assume that until I can get the query working in the command line there's not much point going any further but if Mongoose provides any utility methods that would help solve this problem, those would provide a very acceptable answer.</p>
<p>I feel like this should be a fairly standard case, but I can't find an obvious solution for my problem, or possibly I don't know the correct Mongo terminology to search for. How do I query a parent object based on a subdocument linked relationship?</p>

